    MDBValidationItem
} from 'mdb-react-ui-kit';


export const Signup = () => {

    const onSubmit = (event: React.FormEvent) => {
        event.preventDefault();
        console.log("TODO signup");
    }

    return (
        <div style={{ alignContent: "center", margin: "auto", maxWidth: 420, marginTop: 120 }}>
            <MDBCard>
                <MDBCardBody>
                    <MDBValidation onSubmit={onSubmit}>
                    </MDBValidation>
                </MDBCardBody>
            </MDBCard>
        </div>
    );
}
